import React from 'react';
import '../../App.css';

export default function signup() {
  return (
    <div className='signup'>
      <video autoPlay loop muted className='video-background'>
        <source src='/videos/video.mp4' type='video/mp4' />
    
      </video>
      <h1>Sign Up</h1>
    </div>
  );
}
